import React from "react";
import { useHistory } from "react-router-dom";

const CreateUser = () => {
  const history = useHistory();

  const handleNavigate = () => {
    history.push("/create");
  };

  return (
    <button
      type="button"
      className="btn btn-success"
      onClick={handleNavigate}
    >
      Create DATA
    </button>
  );
};

export default CreateUser;
